      In addition, the GOPAC America contribution was incorrectly entered twice. This
      amended report now shows one contribution from GOPAC America for $500 (check
      number 1035).  3.\tAfter reconciling our deposits with Friends of Tom Rooney,
      we discovered check #093 for $4,000 from Friends of Tom Rooney was deposited
      into the Rooney for Congress campaign account on 10/29/2008. The amendment now
      reflects this previously undisclosed transfer of funds.  4.\tThe term Campaign
      Consulting has now been changed to Campaign Strategy Fee for the entries pertaining
      to EM Campaigns, Inc.  5.\tThe terms of the loan from Mr. Tom Rooney to the
      Rooney for Congress campaign originally stated as due on 11/4/08 have been changed
      to show the loan is now is due by 11/02/10    This amended report is in response
